import ExpenseItem from "./components/ExpenseItem";

const App = () => {

  const expenses = [
    {
      id: 'e1',
      title: 'Toilet Paper',
      amount: 94.12,
      timepoint: new Date(2020, 7, 14),
    },
    {
      id: 'e2',
      title: 'New TV',
      amount: 799.49,
      timepoint: new Date(2021, 2, 12)
    },
    {
      id: 'e3',
      title: 'Car Insurance',
      amount: 294.67,
      timepoint: new Date(2021, 2, 28),
    },
    {
      id: 'e4',
      title: 'New Desk (Wooden)',
      amount: 450,
      timepoint: new Date(2021, 5, 12),
    },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem
        title={expenses[0].title}
        amount={expenses[0].amount}
        timepoint={expenses[0].timepoint}
      />
      <ExpenseItem
        title={expenses[1].title}
        amount={expenses[1].amount}
        timepoint={expenses[1].timepoint}
      />
      <ExpenseItem
        title={expenses[2].title}
        amount={expenses[2].amount}
        timepoint={expenses[2].timepoint}
      />
      <ExpenseItem
        title={expenses[3].title}
        amount={expenses[3].amount}
        timepoint={expenses[3].timepoint}
      />
    </div>
  );
}

export default App;
